import "./App.css";

function App() {
  return (
    <div className="grid-container">
      <header>
        <div>
          <a>e-commerce</a>
        </div>
        <div>
          <a>login</a>
          <a>cart</a>
        </div>
      </header>
      <main>main</main>
      <footer>footer</footer>
    </div>
  );
}

export default App;
